    <View style={styles.tableRow}>
      {items.map((val))}
    </View>
  )
}

export default function ResultTableBase() {
    return (
      <View style={styles.container}>
        <View style={styles.header}>
          <Text>Date</Text>
        </View>
        <View style={styles.table}>
          <Row 
            title=""
            items={[10, 10]}
          />
        </View>
      </View>
    )
  }
  

